// Imports
import Router from 'next/router';
import styled from '@emotion/styled';
import Cookies from 'js-cookie';

// Styles
const Global = styled.div`
  font-family: Arial, Helvetica, sans-serif;
  background-color: honeydew;
  color: seagreen;
  position: absolute;
  height: 100%;
  width: 100%;
`;

const Layout = styled.div`
  width: 50%;
  margin: auto;
  text-align: center;
  img {
    display: inline;
  }
  ul {
    padding-left: 0px;
    list-style-type: none;
  }
`;

// Contexts
import User from '../lib/React/UserContext';

// Components
import Meta from './Meta';
import Header from './Header';

const Page = (props) => {
  if (Cookies.get('grocerylist_auth_token')) {
    return (
      <Global>
        <Layout>
          <User>
            <Meta />
            <Header />
            {props.children}
          </User>
        </Layout>
      </Global>
    );
  } else {
    Router.push('/signin');
  }
};

export default Page;
